import React from "react";

const WhySellOnDaraz = () => {
  return (
    <div style={{ padding: "50px" }}>
      {/* Section: Why Sell on Daraz */}
      <h2 style={{ textAlign: "center", marginBottom: "40px" }}>Why Sell on Daraz?</h2>
      <div
        style={{
          display: "flex",
          justifyContent: "space-around",
          marginBottom: "50px",
        }}
      >
        {/* Icons Section */}
        {[
          { title: "Reach", desc: "Millions of customers on Daraz", icon: "ðŸ“¦" },
          { title: "Free Registration", desc: "Account registration is free", icon: "âœ…" },
          { title: "Reliable Shipping", desc: "Hassle-free delivery", icon: "ðŸšš" },
          { title: "Timely Payments", desc: "Funds are safely deposited", icon: "ðŸ’¸" },
          { title: "Marketing Tools", desc: "Advertise with marketing tools", icon: "ðŸ“Š" },
          { title: "Support & Training", desc: "Learn about ecommerce", icon: "ðŸŽ“" },
        ].map((item, index) => (
          <div
            key={index}
            style={{
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
              width: "120px",
              textAlign: "center",
            }}
          >
            <div style={{ fontSize: "40px" }}>{item.icon}</div>
            <h4>{item.title}</h4>
            <p style={{ fontSize: "14px" }}>{item.desc}</p>
          </div>
        ))}
      </div>

      {/* Section: Testimonies */}
      <div style={{ display: "flex", justifyContent: "space-between", marginBottom: "50px" }}>
        <div style={{ width: "60%" }}>
          <img
            src="/path-to-testimony-image.jpg"
            alt="Testimony"
            style={{ width: "100%", borderRadius: "8px" }}
          />
          <p style={{ fontWeight: "bold", marginTop: "10px" }}>
            We cannot imagine doing business without Daraz now
          </p>
          <p>Ali Khemani, Fashion Distributor</p>
        </div>
        <div style={{ width: "35%", display: "flex", flexDirection: "column", gap: "20px" }}>
          {[
            {
              name: "Zaid Asghar",
              desc:
                "At just 16 years old, Zaid runs his own shop on Daraz. He is an inspiration to budding entrepreneurs.",
            },
            {
              name: "Abdullah Bawa",
              desc:
                "Abdullah used to run a brick-and-mortar business, now seeing a boom after joining Daraz.",
            },
          ].map((person, index) => (
            <div
              key={index}
              style={{
                padding: "20px",
                backgroundColor: "#f8f8f8",
                borderRadius: "8px",
              }}
            >
              <h4 style={{ marginBottom: "10px" }}>Testimony</h4>
              <h5>{person.name}</h5>
              <p>{person.desc}</p>
            </div>
          ))}
        </div>
      </div>

      {/* Section: 5 Simple Steps */}
      <h2 style={{ textAlign: "center", marginBottom: "40px" }}>
        5 Simple Steps to Start Selling
      </h2>
      <div style={{ display: "flex", justifyContent: "space-around" }}>
        {[
          { step: "Signup for Free", icon: "ðŸ“" },
          { step: "Add Profile Information", icon: "ðŸ‘¤" },
          { step: "Add Address Information", icon: "ðŸ¡" },
          { step: "Add ID & Bank Information", icon: "ðŸ’³" },
          { step: "List Products", icon: "ðŸ“¦" },
        ].map((item, index) => (
          <div
            key={index}
            style={{
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
              textAlign: "center",
              width: "120px",
            }}
          >
            <div style={{ fontSize: "40px", marginBottom: "10px" }}>{item.icon}</div>
            <h4>{item.step}</h4>
          </div>
        ))}
      </div>
    </div>
  );
};

export default WhySellOnDaraz;
